import React, { useContext, useEffect } from "react";
import { AiOutlineGlobal, AiOutlineHome } from "react-icons/ai";
import { NavLink as Link } from "react-router-dom";
import { AuthContext } from "../Contexts/AuthContext";

export default function Header() {
  const { logout } = useContext(AuthContext);

  return (
    <div id="header">
      <div
        style={{
          flex: 1,
          display: "flex",
          alignItems: "center",
        }}
      >
        <Link
          className="navButton"
          exact
          to="/"
          activeClassName={"navButton-active"}
        >
          <AiOutlineHome />
        </Link>
      </div>
      {/* <input type="text" /> */}
      <div
        style={{
          flex: 1,
          display: "flex",
          alignItems: "center",
          justifyContent: "flex-end",
        }}
      >
        <input type="search" />
        <div className="navButton" onClick={() => logout()}>
          <AiOutlineGlobal />
        </div>
      </div>
    </div>
  );
}
